import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function Navbar() {
  var stickyEl = document.querySelector(".me_sticky");
  var stickyPosition = stickyEl.getBoundingClientRect().top;
  var offset = -20;
  window.addEventListener("scroll", function () {
    if (window.pageYOffset >= stickyPosition + offset) {
      stickyEl.style.position = "fixed";
      stickyEl.style.top = "0px";
      stickyEl.style.background = "#fff";
    } else {
      stickyEl.style.position = "static";
      stickyEl.style.top = "";
    }
  });
  return (
    <div className="w-full h-full  ">
      <h1 className="text-4xl text-center pt-5 text-red-300 pb-5 ">Medico</h1>
      <div className="me_sticky flex h-14 w-[100%]  top-10  items-center justify-center gap-4 mt-5 ">
        <div className="w-[200px]  flex justify-center h-full border-red-300 border-b-2">
          <Link to="/" className="text-2xl">
            NEWS
          </Link>
        </div>
        <div className="w-[200px] flex justify-center h-full border-red-300 border-b-2">
          <Link to="/blog" className="text-2xl">
            BLOGS
          </Link>
        </div>{" "}
      </div>
    </div>
  );
}

export default Navbar;
